import Carousel from 'react-bootstrap/Carousel';

function CarouselMome() {
  return (
    <Carousel>
      <Carousel.Item interval={1000}>
        <img
          className="d-block w-100"
          src="images/ent_1.jpg"
          alt="First slide"
          height={650}
        />
        
      </Carousel.Item>
      
    </Carousel>
  );
}

export default CarouselMome
